<div class="row">
    <div class="col-lg-12">
        <h1>Edit Profile</h1>
    </div>

<div class="row">
    <div class="col-lg-12" ng-controller="ProfileController" ng-modal="userInfo">
        <section id="customer-signup" class="innerpage">
            <div class="">
                <form class="form-horizontal" ng-submit="updateProfile();" style="padding:0px;">
                    
                    <div class="row">
                        <div class="col-lg-6 col-md-6 col-sm-6 col-xs-12">
                            <div class="form-group">
                                <label class="form-label">Email:</label>
                                <input type="email" ng-model="userInfo.userData.data.data.email" class="form-control" placeholder="Enter your email" ng-required="true" />
                            </div>
                            <div class="form-group">
                                <label class="form-label">Password:</label>
                                <input type="password" ng-model="userInfo.userData.data.data.password" class="form-control" placeholder="Enter your password" ng-required="true" />
                            </div>
                            <div class="form-group">
                                <label class="form-label">Password Confirmation:</label>
                                <input type="password" ng-model="conf_password" class="form-control" placeholder="Confirm your password" ng-required="true" />
                            </div>
                            <div class="form-group">
                                <label class="form-label">Title:</label>
                                <select class="form-control" ng-model="userInfo.userData.data.data.title">
                                    <option value="Mr">Mr</option>
                                    <option value="Miss">Miss</option>
                                    <option value="Mrs">Mrs</option>
                                </select>
                            </div>
                            <div class="form-group">
                                <label class="form-label">First Name:</label>
                                <input type="text" ng-model="userInfo.userData.data.data.first_name" class="form-control" placeholder="Enter you first name" ng-required="true" />
                            </div>
                            <div class="form-group">
                                <label class="form-label">Last Name:</label>
                                <input type="text" ng-model="userInfo.userData.data.data.last_name" class="form-control" placeholder="Enter your last name" ng-required="true" />
                            </div>
                            
                            <div class="form-group">
                                <label class="form-label">Gender:</label><br>
                                        <input name="gender" type="radio" ng-model="userInfo.userData.data.data.gender" value="male" required="required" /> Male <span>&nbsp;&nbsp;&nbsp;&nbsp;
                                            <input name="gender" type="radio" ng-model="userInfo.userData.data.data.gender" value="female" required="required" /> Female
                            </div>
                            <div class="form-group">
                                <label class="form-label">Date of Birth:</label>
                                        <input type="text" ng-model="userInfo.userData.data.data.dob" id="date_of_birth" class="form-control date" placeholder="dd/mm/yy"/>
                            </div>
